  {post_id: 8388, person_id: 1019, body: "It took me some time to decide because they all have something special and unique, but I finally decided on INNA album. \nIt has sentimental value for me because it reminds of all those fun times during summer with my friends and those late, calming nights with long deep talks. During those times we almost always had INNA album playing in the background. We would sing it loudly with smiles on our faces. Those are very important and happy memories to me. It fit perfectly, with summer tracks  like Bad Boys (personal favorite) , Sun Goes Up, Walking on the sun and others, but also with it's slower songs like Salinas Skies, Rendez vous and Fool me. Summer in December also has a special place in my heart.\n Thank you INNA for making our summer one of the best we ever had and sharing a part of you, your energy and feelings with us and all other Clubrockers💙💙", hidden: false},
